function addPartsFromURLs(urls) {
    var partsBin = this,
        partItems = [];

    urls.forEach(function(ea) {
        var partPath = ea.relativePathFrom(URL.codeBase.withFilename("../")),
            match = partPath.match(/(.*\/)(.*).json/);
