function addMorphsForPartItems(partItems, doNotSort) {
    this.removeParts();
    if (!doNotSort) {
        partItems = partItems.sortBy(function(ea) {
            return ea.name.toLowerCase() 
        });
    }

    var pContents = this.get('partsBinContents');
    pContents.stopAddingPartItemsAsync();
