5654.source:
function commitLogString(metaInfo) {
    if (!metaInfo.changes) return "";
    return metaInfo.changes
        .reverse()
        .collect(function(ea) {
            return Strings.format("%s %s: \n    %s\n\n",
                ea.date.format("yyyy-mm-dd HH:MM") , 
                ea.author, (ea.message || "no comment"));
        })
        .join('');
}

